import { observable, decorate } from "mobx";

class PongStore {
  firsttop = window.innerHeight / 2;
  secondtop = window.innerHeight / 2;
}
decorate(PongStore, {
  firsttop: observable,
  secondtop: observable
});

export default new PongStore();
